import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";

export default function PatientDetails({ client }) {
  const { id } = useParams();
  const [patient, setPatient] = useState(null);
  const [notes, setNotes] = useState([]);
  const [conditions, setConditions] = useState([]);

  // Fetch patient details
  useEffect(() => {
    client.request(`Patient/${id}`).then((data) => setPatient(data));

    // Fetch patient notes
    client
      .request(`DocumentReference?patient=${id}`)
      .then((data) => setNotes(data.entry || []));

    // Fetch patient conditions (ICD codes)
    client
      .request(`Condition?patient=${id}`)
      .then((data) => setConditions(data.entry || []));
  }, [client, id]);

  const saveChanges = () => {
    client.update(patient).then(() => {
      alert("Patient details updated successfully!");
    });
  };

  return (
    <div className="patient-details">
      {patient ? (
        <>
          <h1>
            {patient.name?.[0]?.given?.join(" ")} {patient.name?.[0]?.family}
          </h1>

          {/* Display patient details */}
          <div>
            <label>Gender:</label>
            <input
              type="text"
              value={patient.gender || ""}
              onChange={(e) => setPatient({ ...patient, gender: e.target.value })}
            />
          </div>

          <div>
            <label>Birthdate:</label>
            <input
              type="date"
              value={patient.birthDate || ""}
              onChange={(e) =>
                setPatient({ ...patient, birthDate: e.target.value })
              }
            />
          </div>

          <h2>Notes</h2>
          {notes.length > 0 ? (
            notes.map((entry, index) => (
              <div key={index}>
                <p>
                  <strong>Title:</strong> {entry.resource?.type?.text || "Untitled"}
                </p>
                <p>
                  <strong>Date:</strong> {entry.resource?.date || "Unknown"}
                </p>
                <p>
                  <strong>Content:</strong> {entry.resource?.content?.[0]?.attachment?.data || "No content available"}
                </p>
              </div>
            ))
          ) : (
            <p>No notes available.</p>
          )}

          <h2>ICD Codes</h2>
          {conditions.length > 0 ? (
            conditions.map((entry, index) => (
              <div key={index}>
                <p>
                  <strong>Condition:</strong>{" "}
                  {entry.resource?.code?.coding?.[0]?.display || "Unknown"}
                </p>
                <p>
                  <strong>ICD Code:</strong>{" "}
                  {entry.resource?.code?.coding?.[0]?.code || "N/A"}
                </p>
                <p>
                  <strong>Status:</strong> {entry.resource?.clinicalStatus?.text || "N/A"}
                </p>
              </div>
            ))
          ) : (
            <p>No ICD codes available.</p>
          )}

          <button onClick={saveChanges}>Save Changes</button>
        </>
      ) : (
        <p>Loading patient data...</p>
      )}
    </div>
  );
}
